import '../styles/NewSession2.css'

const NewSession2 = ({API_URL, onShow, session, setSession, exercisesSession, setExercisesSession, exercises}) => {
  const handleSession = (key, value) => {
    let updated = {...session}
    updated[key] = value

    setSession(updated)
  }

  return (
    <div className='se-form-container'>
      <form>
        <div className='row-section'>
            <input 
              type='text'
              placeholder='Nombre'
              value={session.name}
              onChange={(e) => handleSession('name', e.target.value)}
              />

            <textarea
              className='description-field'
